import './LoggedFilm.css'

function LoggedFilm() {
    return (
        <div className="logged-film">
            <div>Date</div>
            <div className="logged-film__description">
                <div>Title</div>
                <div className="logged-film__">Rating</div>
            </div>
        </div>
    )
}

export default LoggedFilm;
